                  <p className="text-slate-500">
                    No invoiced deals found for the selected period
                  </p>
                </div>
              )}
            </>
          )}
        </div>
      </div>
    </DashboardLayout>
  );
}

/**
 * Tenant-aware Reports Route
 * /app/[dealerSlug]/reports
 *
 * Wraps the consolidated reports page with tenant context.
 */

import TenantPage from "@/components/TenantPage";
import ReportsPage from "@/pages/reports/index";

export default function TenantReports() {
  return (
    <TenantPage>
      <ReportsPage />
    </TenantPage>
  );
}

