    60→  // Calculate period dates
    61→  const getPeriodDates = useCallback(() => {
    62→    const now = new Date();
    63→    const today = new Date(now.getFullYear(), now.getMonth(), now.getDate());
    64→
    65→    switch (periodType) {
    66→      case "this_month":
    67→        return {
    68→          from: new Date(now.getFullYear(), now.getMonth(), 1),
    69→          to: new Date(now.getFullYear(), now.getMonth() + 1, 0, 23, 59, 59),
    70→        };
    71→      case "last_month":
    72→        return {
    73→          from: new Date(now.getFullYear(), now.getMonth() - 1, 1),
    74→          to: new Date(now.getFullYear(), now.getMonth(), 0, 23, 59, 59),
    75→        };
    76→      case "quarter":
    77→        const quarterStart = Math.floor(now.getMonth() / 3) * 3;
    78→        return {
    79→          from: new Date(now.getFullYear(), quarterStart, 1),
    80→          to: new Date(now.getFullYear(), quarterStart + 3, 0, 23, 59, 59),
    81→        };
    82→      case "last_quarter":
    83→        const lastQuarterStart = Math.floor(now.getMonth() / 3) * 3 - 3;
    84→        return {
    85→          from: new Date(now.getFullYear(), lastQuarterStart, 1),
    86→          to: new Date(now.getFullYear(), lastQuarterStart + 3, 0, 23, 59, 59),
    87→        };
    88→      case "ytd":
    89→        return {
    90→          from: new Date(now.getFullYear(), 0, 1),
    91→          to: today,
    92→        };
    93→      case "custom":
    94→        return {
    95→          from: customFrom ? new Date(customFrom) : null,
    96→          to: customTo ? new Date(customTo + "T23:59:59") : null,
    97→        };
    98→      default:
    99→        return { from: null, to: null };
   100→    }
   101→  }, [periodType, customFrom, customTo]);
   102→
   103→  // Fetch all data
   104→  const fetchData = useCallback(async () => {
   105→    setIsLoading(true);
   106→    try {
   107→      const [dealsRes, vehiclesRes, aftercareRes] = await Promise.all([
   108→        fetch("/api/deals"),
   109→        fetch("/api/vehicles"),
   110→        fetch("/api/aftercare"),
   111→      ]);
   112→
   113→      if (dealsRes.ok) {
   114→        const data = await dealsRes.json();
   115→        setDeals(data);
   116→      }
   117→      if (vehiclesRes.ok) {
   118→        const data = await vehiclesRes.json();
   119→        setVehicles(data.vehicles || data || []);
   120→      }
   121→      if (aftercareRes.ok) {
   122→        const data = await aftercareRes.json();
   123→        setAftercareCases(data.cases || data || []);
   124→      }
   125→    } catch (error) {
   126→      console.error(error);
   127→      toast.error("Failed to load report data");
   128→    } finally {
   129→      setIsLoading(false);
   130→    }
