   141→  // ==================== SALES SUMMARY ====================
   142→  const calculateSales = useCallback(() => {
   143→    if (!from || !to) return { deals: [], totalGross: 0, totalNet: 0, totalVat: 0, dealCount: 0 };
   144→
   145→    const completedDeals = deals.filter((deal) => {
   146→      if (!["INVOICED", "DELIVERED", "COMPLETED"].includes(deal.status)) return false;
   147→      if (!deal.invoicedAt) return false;
   148→      const invoiceDate = new Date(deal.invoicedAt);
   149→      return invoiceDate >= from && invoiceDate <= to;
   150→    });
   151→
   152→    const totalGross = completedDeals.reduce((sum, d) => sum + (d.vehiclePriceGross || 0), 0);
   153→    const totalNet = completedDeals.reduce((sum, d) => sum + (d.vehiclePriceNet || 0), 0);
   154→    const totalVat = completedDeals.reduce((sum, d) => sum + (d.vehicleVatAmount || 0), 0);
   155→
   156→    return { deals: completedDeals, totalGross, totalNet, totalVat, dealCount: completedDeals.length };
   157→  }, [deals, from, to]);
   158→
   159→  // ==================== VAT REPORT ====================
   160→  const calculateVAT = useCallback(() => {
   161→    if (!from || !to) return { vatQualifyingDeals: [], marginDeals: [], totalOutputVAT: 0, totalSalesGross: 0, totalSalesNet: 0, totalMarginGross: 0 };
   162→
   163→    const invoicedDeals = deals.filter((deal) => {
   164→      if (!["INVOICED", "DELIVERED", "COMPLETED"].includes(deal.status)) return false;
   165→      if (!deal.invoicedAt) return false;
   166→      const invoiceDate = new Date(deal.invoicedAt);
   167→      return invoiceDate >= from && invoiceDate <= to;
   168→    });
   169→
   170→    const vatQualifyingDeals = invoicedDeals.filter(d => d.vatScheme === "VAT_QUALIFYING");
   171→    const marginDeals = invoicedDeals.filter(d => d.vatScheme === "MARGIN");
   172→
   173→    let totalOutputVAT = 0;
   174→    let totalSalesGross = 0;
   175→    let totalSalesNet = 0;
   176→
   177→    vatQualifyingDeals.forEach((deal) => {
   178→      totalOutputVAT += deal.vehicleVatAmount || 0;
   179→      totalSalesGross += deal.vehiclePriceGross || 0;
   180→      totalSalesNet += deal.vehiclePriceNet || 0;
   181→    });
   182→
   183→    marginDeals.forEach((deal) => {
   184→      totalSalesGross += deal.vehiclePriceGross || 0;
   185→    });
   186→
   187→    return {
   188→      vatQualifyingDeals,
   189→      marginDeals,
   190→      totalOutputVAT,
   191→      totalSalesGross,
   192→      totalSalesNet,
   193→      totalMarginGross: marginDeals.reduce((sum, d) => sum + (d.vehiclePriceGross || 0), 0),
   194→    };
   195→  }, [deals, from, to]);
   196→
   197→  // ==================== INVENTORY ====================
   198→  const calculateInventory = useCallback(() => {
   199→    const now = new Date();
   200→    let totalValue = 0;
   201→    let totalCost = 0;
   202→    let count = 0;
   203→    const byMake = {};
   204→    const byAge = {
   205→      "0-30": { count: 0, value: 0 },
   206→      "31-60": { count: 0, value: 0 },
   207→      "61-90": { count: 0, value: 0 },
   208→      "90+": { count: 0, value: 0 },
   209→    };
   210→
   211→    vehicles.forEach((vehicle) => {
   212→      if (vehicle.salesStatus === "SOLD" || vehicle.salesStatus === "DELIVERED" || vehicle.salesStatus === "COMPLETED") return;
   213→
   214→      count++;
   215→      const askingPrice = vehicle.askingPrice || vehicle.retailPrice || 0;
   216→      const costPrice = vehicle.purchase?.purchasePriceNet || 0;
   217→
   218→      totalValue += askingPrice;
   219→      totalCost += costPrice;
   220→
   221→      const make = vehicle.make || "Unknown";
   222→      if (!byMake[make]) byMake[make] = { count: 0, value: 0, cost: 0 };
   223→      byMake[make].count++;
   224→      byMake[make].value += askingPrice;
   225→      byMake[make].cost += costPrice;
   226→
   227→      const purchaseDate = vehicle.purchase?.purchaseDate
   228→        ? new Date(vehicle.purchase.purchaseDate)
   229→        : vehicle.createdAt ? new Date(vehicle.createdAt) : now;
   230→      const ageInDays = Math.floor((now - purchaseDate) / (1000 * 60 * 60 * 24));
   231→
   232→      for (const bucket of AGE_BUCKETS) {
   233→        if (ageInDays >= bucket.min && ageInDays <= bucket.max) {
   234→          byAge[bucket.key].count++;
   235→          byAge[bucket.key].value += askingPrice;
   236→          break;
   237→        }
   238→      }
   239→    });
   240→
   241→    const makeBreakdown = Object.entries(byMake)
   242→      .map(([make, data]) => ({ make, ...data }))
   243→      .sort((a, b) => b.count - a.count);
   244→
   245→    return { totalVehicles: count, totalValue, totalCost, potentialProfit: totalValue - totalCost, avgValue: count > 0 ? totalValue / count : 0, byAge, makeBreakdown };
   246→  }, [vehicles]);
   247→
   248→  // ==================== STOCK BOOK ====================
   249→  const calculateStockBook = useCallback(() => {
   250→    if (!from || !to) return { entries: [], totalPurchases: 0, totalSales: 0, totalProfit: 0 };
   251→
   252→    // Find vehicles sold in the period
   253→    const soldVehicles = vehicles.filter(v => {
   254→      if (!v.soldAt) return false;
   255→      const soldDate = new Date(v.soldAt);
   256→      return soldDate >= from && soldDate <= to;
   257→    });
   258→
   259→    // Match with deals for sale prices
   260→    const entries = soldVehicles.map(vehicle => {
   261→      const deal = deals.find(d => d.vehicleId === vehicle.id || d.vehicleId?._id === vehicle.id);
   262→      const purchasePrice = vehicle.purchase?.purchasePriceNet || 0;
   263→      const salePrice = deal?.vehiclePriceGross || 0;
   264→      const profit = salePrice - purchasePrice;
   265→
   266→      return {
   267→        vrm: vehicle.regCurrent,
   268→        make: vehicle.make,
   269→        model: vehicle.model,
   270→        year: vehicle.year,
   271→        purchaseDate: vehicle.purchase?.purchaseDate,
   272→        purchasePrice,
   273→        soldAt: vehicle.soldAt,
   274→        salePrice,
   275→        profit,
   276→        margin: salePrice > 0 ? ((profit / salePrice) * 100).toFixed(1) : 0,
   277→      };
   278→    });
   279→
   280→    const totalPurchases = entries.reduce((sum, e) => sum + e.purchasePrice, 0);
   281→    const totalSales = entries.reduce((sum, e) => sum + e.salePrice, 0);
   282→    const totalProfit = entries.reduce((sum, e) => sum + e.profit, 0);
   283→
   284→    return { entries, totalPurchases, totalSales, totalProfit };
   285→  }, [vehicles, deals, from, to]);
   286→
   287→  // ==================== MOST PROFITABLE MODELS ====================
   288→  const calculateProfitableModels = useCallback(() => {
   289→    // Group completed deals by make/model
   290→    const modelProfits = {};
   291→
   292→    deals.forEach(deal => {
   293→      if (!["INVOICED", "DELIVERED", "COMPLETED"].includes(deal.status)) return;
   294→
   295→      const key = `${deal.vehicle?.make || "Unknown"} ${deal.vehicle?.model || ""}`.trim();
   296→      if (!modelProfits[key]) {
   297→        modelProfits[key] = { make: deal.vehicle?.make, model: deal.vehicle?.model, count: 0, totalRevenue: 0, totalCost: 0, totalProfit: 0 };
   298→      }
   299→
   300→      const purchasePrice = deal.vehicle?.purchase?.purchasePriceNet || 0;
   301→      const salePrice = deal.vehiclePriceGross || 0;
   302→      const profit = salePrice - purchasePrice;
   303→
   304→      modelProfits[key].count++;
   305→      modelProfits[key].totalRevenue += salePrice;
   306→      modelProfits[key].totalCost += purchasePrice;
   307→      modelProfits[key].totalProfit += profit;
   308→    });
   309→
   310→    return Object.values(modelProfits)
   311→      .map(m => ({
   312→        ...m,
   313→        avgProfit: m.count > 0 ? m.totalProfit / m.count : 0,
   314→        margin: m.totalRevenue > 0 ? ((m.totalProfit / m.totalRevenue) * 100).toFixed(1) : 0,
   315→      }))
   316→      .sort((a, b) => b.totalProfit - a.totalProfit)
   317→      .slice(0, 20);
   318→  }, [deals]);
