   320→  // ==================== WARRANTY COSTS ====================
   321→  const calculateWarrantyCosts = useCallback(() => {
   322→    if (!from || !to) return { cases: [], totalCost: 0, caseCount: 0, avgPerCase: 0 };
   323→
   324→    const periodCases = aftercareCases.filter(c => {
   325→      const caseDate = new Date(c.createdAt);
   326→      return caseDate >= from && caseDate <= to;
   327→    });
   328→
   329→    const totalCost = periodCases.reduce((sum, c) => {
   330→      const partsNet = c.costs?.partsNet || 0;
   331→      const labourNet = c.costs?.labourNet || 0;
   332→      return sum + partsNet + labourNet;
   333→    }, 0);
   334→
   335→    return {
   336→      cases: periodCases,
   337→      totalCost,
   338→      caseCount: periodCases.length,
   339→      avgPerCase: periodCases.length > 0 ? totalCost / periodCases.length : 0,
   340→    };
   341→  }, [aftercareCases, from, to]);
