   351→  // Export handlers
   352→  const handleExportCSV = () => {
   353→    let headers = [];
   354→    let rows = [];
   355→    let filename = "";
   356→
   357→    switch (activeTab) {
   358→      case "sales":
   359→        headers = ["Invoice Date", "Deal #", "VRM", "Make", "Model", "Customer", "Net", "VAT", "Gross"];
   360→        rows = salesData.deals.map(d => [
   361→          formatDate(d.invoicedAt), d.dealNumber || "", d.vehicle?.regCurrent || "", d.vehicle?.make || "",
   362→          d.vehicle?.model || "", d.customer?.displayName || "", (d.vehiclePriceNet || 0).toFixed(2),
   363→          (d.vehicleVatAmount || 0).toFixed(2), (d.vehiclePriceGross || 0).toFixed(2)
   364→        ]);
   365→        filename = "sales-summary";
   366→        break;
   367→      case "vat":
   368→        headers = ["Invoice Date", "Deal #", "VRM", "Customer", "VAT Scheme", "Net", "VAT", "Gross"];
   369→        rows = [...vatData.vatQualifyingDeals, ...vatData.marginDeals].map(d => [
