   372→          (d.vehiclePriceGross || 0).toFixed(2)
   373→        ]);
   374→        filename = "vat-report";
   375→        break;
   376→      case "stockbook":
   377→        headers = ["VRM", "Make", "Model", "Year", "Purchase Date", "Purchase Price", "Sale Date", "Sale Price", "Profit", "Margin %"];
   378→        rows = stockBookData.entries.map(e => [
   379→          e.vrm || "", e.make || "", e.model || "", e.year || "", formatDate(e.purchaseDate),
   380→          e.purchasePrice.toFixed(2), formatDate(e.soldAt), e.salePrice.toFixed(2), e.profit.toFixed(2), e.margin
   381→        ]);
   382→        filename = "stock-book";
   383→        break;
   384→      case "warranty":
